import React, { Component } from 'react';

export default class ResultBook extends Component {
    render () {
        return (
            <div className="result-book">
                <img className="result-book-img" src="https://bookshow.blurb.com/bookshow/cache/P2269973/md/cover_2.jpeg?access_key=b72e6d56485105d43eb9d13fc3553e9c"></img>
                <div className="result-book-infp">
                    <h3 className="result-book-title">The Kite and Flower</h3>
                    <h2 className="result-book-author">Marts Coughlin</h2>
                    <p className="result-book-overview">What beauty was the kite able to see that made the flower wish to fly? "... Sometimes they will both be still - the kite hovering motionless above the boy; the boy staring wistfully up at the ki..., September 27, 2010</p>
                    <h2 className="result-book-price">$30</h2>
                    <button className="add-to-cart-button">Add to Cart</button>
                </div>
            </div>
        );
    }
}
